<script>


    function uniq(array){
        var temp = [];
        for(var i = 0; i < array.length; i++){
            if(temp.indexOf(array[i]) == -1){
                temp.push(array[i]);
            }
        }
        return temp;
    }
    function qh(o,co){
        for(let i=0;i<co;i++){
            o[o.length]=o[i];
        }
        for(let i=0;i<o.length-co;i++){
            o[i]=o[i+co];
        }
        o=uniq(o);
        return o;
    }
</script>
